	'messages:config-sqlite-parent-unwritable-nogroup' => 'ru:Не удалось создать директорию для данных <code><nowiki>$1</nowiki></code>, так как у веб-сервера нет прав на запись в родительскую директорию <code><nowiki>$2</nowiki></code>.

