	'messages:config-pingback-help' => 'ru:Если вы выберите этот вариант, MediaWiki будет периодически отправлять на https://www.mediawiki.org основные сведения об этом экземпляре MediaWiki. К этим данным относятся, в частности, тип операционной системы, версия PHP и выбранная СУБД. Фонд Викимедиа делится этими данными с разработчиками MediaWiki, чтобы помочь им в дальнейшей разработке. Следующие данные будут отправлены для вашей системы:
<pre>$1</pre>

