	'messages:config-upload-help' => 'ru:Разрешение загрузки файлов, потенциально, может привести к угрозе безопасности сервера.
Для получения дополнительной информации, прочтите в руководстве [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security раздел, посвящённый безопасности].

