	'messages:managewiki-header-extensions-view' => 'ru:Вы можете просматривать расширения и скины этой вики на этой панели, но \'\'\'у вас нет разрешения ими управлять\'\'\'. Если вам нужно включить расширение или скин, свяжитесь с операторами этой вики.',
