	'messages:managewiki-header-namespaces-view' => 'ru:Вы можете просматривать настройки пространств имён этой вики на этой панели, но \'\'\'у вас нет разрешения их изменять\'\'\'. Обратитесь к операторам вики, если вам нужна дополнительная помощь.',
	'messages:managewiki-header-permissions' => 'ru:Вы можете управлять настройками групп участников этой вики (такими как разрешения, назначение групп и автоматическое продвижение) с этой панели. Пожалуйста, очень внимательно прочитайте документацию и не удаляйте группы бесцеремонно, иначе ваша вики может сломаться. По окончаний действий нажмите «Сохранить», и указанные вами параметры отобразятся через несколько секунд.

Не все разрешения могут быть назначены. Некоторые из них могут быть зарезервированы только для операторов фермы. Если вы не нашли определенные разрешения, обратитесь к своей ферме.',
	'messages:managewiki-header-permissions-view' => 'ru:Вы можете просматривать настройки групп участников этой вики на этой панели (такие как разрешения, назначения и автопродвижение), но \'\'\'у вас нет разрешения их изменять\'\'\'. Обратитесь к операторам вики, если вам нужна дополнительная помощь.',
	'messages:managewiki-header-settings' => 'ru:Вы можете управлять настройками этой вики (такими как логотип, стиль и прочее) с этой панели. Будьте осторожны! Обязательно внимательно прочитайте описания настроек и не переключайте случайные настройки без разбора, если вы не понимаете, что они делают. По окончании действий нажмите «Сохранить», и указанные вами параметры отобразятся через несколько секунд. 

Выделенные серым параметры могут изменять только операторы фермы. Вы можете управлять ключевыми настройками, такими как название и язык вики, на странице [[Special:ManageWiki/core]].',
